import logo from './logo.svg';
import './App.css';

import {applyRouterMiddleware, BrowserRouter as Router, Routes, Route}
    from 'react-router-dom';
import {  Link } from "react-scroll";
import SubmitForm from './pages/SubmitForm'
import Project from './pages/Project'
import AboutMe from './pages/AboutMe'
import styled, { createGlobalStyle } from "styled-components";
const Wrapper = styled.div`
 scroll-snap-type: y mandatory;
  max-height: 100vh;
  overflow-y: scroll;
`;
function App() {

  return (

    <div className="App">

      <header className="nav">

        <nav className="nav__container__actions">
          <ul>
            <li>
              <Link activeClass="active"  to="about">
                ABOUT
              </Link>
            </li>
            <li>
              <Link activeClass="active"  to="projects">
                PROJECTS
              </Link>
            </li>
            <li>
              <Link activeClass="active"  to="blog">
                BLOG
              </Link>
            </li>
            <li>
              <Link activeClass="active" smooth spy to="contact">
                CONTACT ME
              </Link>
            </li>
          </ul>
        </nav>

      </header>

      <section id="about"><AboutMe></AboutMe></section>
      <section id="projects"><Project/></section>
      <section id="blog"><SubmitForm/></section>

    </div>

  );
}

export default App;
